import React from "react";

const ProductInfo = (props) =>{
    const {name, price, description} = props.product;
    return (
        <div>
            <h2>NAME: {name}</h2>
            <h1>PRICE: {price}</h1>
            <p>Description: {description}</p>
        </div>
    );
};

export default ProductInfo;
